function Home() {
  return (
    <div>
      <div className="wrapper">
        <div className="row">
            <div className="col-md-12">
          <button className="login">Login</button>
          <button className="signup">Signup</button>
          </div>
        </div>
      </div>
    </div>
  );
}
  
  export default Home;
